import { styled, Card, Button, CardActions } from "@mui/material";

export const MyCard = styled(Card)({
  width: "445px",
  height: "350px",
  margin: "20px",
  alignItems: "center",
});

export const MyTypography = styled("span")({
  display: "inline-block",
  overflow: "auto",
  height: "50px",
  fontSize:"12px",
  margin: "0px"
});

export const MyButton = styled(CardActions)({
  textTransform: "capitalize",
})
